import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchAllBorrowedBooks } from "../Features/BorrowedBookAdminSlice";

const BorrowedList = () => {
  const dispatch = useDispatch();
  const { borrowedBooks, isLoading } = useSelector(state => state.borrowedAdmin);

  useEffect(() => {
    dispatch(fetchAllBorrowedBooks());
  }, [dispatch]);

  if (isLoading) return <p>Loading...</p>;

  return (
    <div>
      <h3>All Borrowed Books</h3>
      {borrowedBooks.map(b => (
        <div key={b._id}>
          <p>User: {b.studentUsername}</p>
          <p>Book: {b.book?.title}</p>
          <p>Feedback: {b.feedback}</p>
          <p>Rating: {b.rating}</p>
        </div>
      ))}
    </div>
  );
};

export default BorrowedList;
